import React from 'react';
import {useDispatch} from "react-redux";
import {Field, Form, Formik} from "formik";
import {createUserRequest} from "../../slices/userSlices";
import styles from './SignUpForm.module.scss';


const SignUpForm = () => {

  const dispatch = useDispatch();

  const onSubmit = (values, formikBag)=>{
    dispatch(createUserRequest(values))
    console.log(values);
    formikBag.resetForm();
  };

  return (
     <div  className={styles.form}>
          <Formik  onSubmit={onSubmit} initialValues={{firstName: '',lastName: '',email: '',password: '',birthday:''}}>
      <Form className={styles.form} >
        <Field name="firstName" placeholder='Name' className={styles.inputBoxName} />
      <Field name="lastName" placeholder='Last' />
      <Field name="email" placeholder='Email' />
      <Field name="password" placeholder='password' />
      <Field type='date' name="birthday" placeholder='birthday' />
      <Field name='submit' type='submit' value='Join now' />
      </Form>
    </Formik>
     </div>
   
   

  );
}
export default SignUpForm;
